CREATE TABLE `attacks_logs` (
  `id` int(11) DEFAULT NULL,
  `rang` varchar(50) DEFAULT NULL,
  `id_target` int(11) DEFAULT NULL,
  `hps` int(11) DEFAULT NULL,
  `strength` int(11) DEFAULT NULL,
  `agility` int(11) DEFAULT NULL,
  `rapidity` int(11) DEFAULT NULL,
  `win` tinyint(1) DEFAULT NULL,
  `AI_guess` float DEFAULT NULL,
  `FlashVars` varchar(150) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
CREATE TABLE `brutes` (
  `id` int(11) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `rang` varchar(50) DEFAULT NULL,
  `level` int(11) DEFAULT NULL,
  `hps` int(11) DEFAULT NULL,
  `strength` int(11) DEFAULT NULL,
  `agility` int(11) DEFAULT NULL,
  `rapidity` int(11) DEFAULT NULL,
  `xp` int(11) DEFAULT NULL,
  `xp_max` int(11) DEFAULT NULL,
  `injuries` int(11) DEFAULT NULL,
  `victories` int(11) DEFAULT NULL,
  `last_heal_datetime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
